import React from 'react';
import {
    Text,
    View,
} from 'react-native';

const Favourite = () => {
    return (
        <View
            style={{
                flex: 1,
                alignItems: 'center',
                justifyContent: 'center'
            }}
        >
            <Text>Favourite</Text>
        </View>
    )
}

export default Favourite
